import Todo from "./Todo/Todo";

const TodoList = ({toDoList, handleToggle}) => {

  return (
      <div>
        {toDoList.map(todo => {
          return (
              <Todo todo={todo} handleToggle={handleToggle}/>
          )
        })}
      </div>
  );
}

export default TodoList;
